INSERT INTO `films_polls_film` VALUES (30,'Матрица','фильм о двух таблетках ','films_polls/2017/02/16/фильмы-реквием-по-мечте-делимся-бесценным-песочница-72448.jpeg',1,'2017-02-16 13:55:54.000000'),(32,'Бриллиантовая рука','орлдлодлдлордшлждщ','films_polls/2017/02/16/ruka_7JgBBsb.jpg',1,'2017-02-16 14:04:03.000000'),(34,'Операция Ы','lkvlkblfvkb','films_polls/2017/02/16/ruka_zpOEehy.jpg',1,'2017-02-16 14:06:53.000000'),(36,'Матрица(1998)','Жизнь Томаса Андерсона разделена на две части: днём он самый обычный офисный работник, получающий нагоняи от начальства, а ночью превращается в хакера по имени Нео, и нет места в сети, куда он не смог бы дотянуться. Но однажды всё меняется — герой, сам того не желая, узнаёт страшную правду: всё, что его окружает — не более, чем иллюзия, Матрица, а люди — всего лишь источник питания для искусственного интеллекта, поработившего человечество. И только Нео под силу изменить расстановку сил в этом ставшем вдруг чужим и страшным мире.','films_polls/2017/02/16/фильмы-реквием-по-мечте-делимся-бесценным-песочница-72448.jpeg',0,'2017-02-16 18:02:07.000000'),(37,'Ла-Ла Ленд (2016)','Это история любви старлетки, которая между прослушиваниями подает кофе состоявшимся кинозвездам, и фанатичного джазового музыканта, вынужденного подрабатывать в заштатных барах. Но пришедший к влюбленным успех начинает подтачивать их отношения.','films_polls/2017/02/16/лалаленд.jpg',0,'2017-02-16 18:04:19.000000'),(38,'Гуляй, Вася! (2017)','Бедный Митя влип по полной: случайно сделал предложение, а отец девушки, как будто только этого и ждал — тут же назначил дату свадьбы. Все бы ничего, да только Митя… уже женат! Он возвращается в свой город, чтобы экстренно развестись. Но Василиса (или просто Вася), с которой они давно не живут, — циничная стерва, и за развод придется побороться. Простейший способ ускорить процесс — предъявить первую попавшуюся «невесту». Кто же знал, что у нее имеется настоящий жених, местный качок… Окончательно все запутывается, когда разруливать ситуацию берутся бывшие одноклассники Мити — подкаблучник Паша и аферист Гарик.','films_polls/2017/02/16/Гуляи_вася.jpg',0,'2017-02-16 18:05:26.000000'),(39,'Союзники (2016)','1942 год. Во время опасной миссии в Северной Африке разведчик Макс встречает участницу сопротивления Марианну. Их чувствам суждено подвергнуться тысяче испытаний, главным из которых станет испытание правдой…','films_polls/2017/02/16/союзники.jpg',0,'2017-02-16 18:06:34.000000'),(40,'Пятьдесят оттенков серого (2015)','\r\nАнастейша Стил — скромная студентка, живущая вместе с близкой подругой-сокурсницей Кейт. За неделю до выпускного в университете Анастейша, по просьбе заболевшей Кейт заменить её, берёт интервью у молодого красавца-миллиардера Кристиана Грея. Интервью складывается не очень удачно, и Анастейша не думает, что они когда-либо встретятся вновь. Неожиданно Грей появляется в хозяйственном магазине, где девушка работает продавцом. Их знакомство продолжается, и Анастейша постепенно узнаёт о тайных сексуальных увлечениях богача.','films_polls/2017/02/16/50_оттенков_серого.jpg',0,'2017-02-16 18:08:32.000000'),(41,'Зверопой (2016)','Каждое животное мечтает стать звездой. Слониха, баран, бык, и даже хрюшка, буквально все рвутся к славе. Кто знает, кому улыбнется капризная фортуна и чей портрет украсит завтра обложки глянцевых журналов. Все как у людей…','films_polls/2017/02/16/зверопои.jpg',0,'2017-02-16 18:10:14.000000'),(42,'Девушка в поезде (2016)','Райчел приходит в дом Скотта чтобы сообщить подробности о Меган, он предлагает ей кофе. Ставит кружку на столик рядом со стулом где она садится. На 40:49 минуте ручка кружки повернута в сторону зрителя, затем в следующем кадре 41:01 ручка повернута уже в сторону сидящей Райчел (хотя та её ещё не касалась). Зритель отчетливо видит старый след от губной помады на кружке. На 41:06 ручка кружки снова повернута в сторону зрителя, Райчел только после этого берёт её в руки, замечает след от помады и поворачивает её в ладонях чтобы пить с другой стороны.','films_polls/2017/02/16/девушка_в_поезде.jpg',0,'2017-02-16 18:11:51.000000'),(43,'Шерлок (2010 – ...)','События разворачиваются в наши дни. Он прошел Афганистан, остался инвалидом. По возвращении в родные края встречается с загадочным, но своеобразным гениальным человеком. Тот в поиске соседа по квартире. Лондон, 2010 год. Происходят необъяснимые убийства. Скотланд-Ярд без понятия, за что хвататься. Существует лишь один человек, который в силах разрешить проблемы и найти ответы на сложные вопросы.','films_polls/2017/02/16/шерлок.jpg',0,'2017-02-16 18:14:35.000000'),(44,'Дом странных детей Мисс Перегрин (2016)','\r\nДетство Джейкоба прошло под рассказы дедушки о приюте для необычных детей. Среди его обитателей девочка, которая умела держать в руках огонь, девочка, чьи ноги не касались земли, невидимый мальчик и близнецы, умевшие общаться без слов. Когда дедушка умирает, 16-летний Джейкоб получает загадочное письмо и отправляется на остров, где вырос его дед. Там он находит детей, которых раньше видел только на фотографиях.','films_polls/2017/02/16/перигрин.jpg',0,'2017-02-16 18:17:33.000000'),(45,'Люди Икс: Апокалипсис (2016)','События «Дней Минувшего Будущего» оказали колоссальное влияние на мир, где мутанты и люди борются за свое место под Солнцем. В это нелегкое время Людям Икс предстоит столкнуться со своим самым опасным противником — древним мутантом Апокалипсисом, существом, схватка с которым может стать последней не только для мутантов, но и в принципе для всего человечества. В поисках способа победы над неуязвимым и бессмертным монстром Людям Икс предстоит узнать больше о происхождении своего вида. Но Апокалипсис неимоверно силен, и вероятность победы все уменьшается, ведь он твердо убежден, что только сильнейшие имеют право на выживание…','films_polls/2017/02/16/люди_икс.jpg',0,'2017-02-16 18:18:34.000000'),(46,'Начало (2010)','Кобб — талантливый вор, лучший из лучших в опасном искусстве извлечения: он крадет ценные секреты из глубин подсознания во время сна, когда человеческий разум наиболее уязвим. Редкие способности Кобба сделали его ценным игроком в привычном к предательству мире промышленного шпионажа, но они же превратили его в извечного беглеца и лишили всего, что он когда-либо любил...','films_polls/2017/02/16/начало.jpg',0,'2017-02-16 18:20:40.000000'),(47,'Босс-молокосос (2017)','Эта актуальная во все времена история для взрослых и детей рассказывается от лица семилетнего брата новорожденного — фантазера Тима, который ревнует его к родителям. Но главный герой — совсем не простой ребенок, он обладает лидерскими задатками, уже носит деловые костюмы и во всем видит бизнес-задачу.','films_polls/2017/02/16/босс_молокосос.jpg',0,'2017-02-16 18:21:53.000000'),(48,'Шоу Трумана (1998)','\r\nПредставьте себе, что вы вдруг начинаете понимать, что все вокруг вас — декорации, а люди — актеры, притворяющиеся теми, кем они вам кажутся. Весь ваш мир оказывается большим телесериалом, где вы исполняете главную роль, даже не подозревая об этом. Вся ваша жизнь — результат работы автора телешоу, которое вот уже тридцать лет смотрит вся планета, начиная с момента вашего рождения.','films_polls/2017/02/16/шоу_трумана.jpg',0,'2017-02-16 18:23:09.000000'),(49,'Сумерки (2008)','Семнадцатилетняя девушка Белла переезжает к отцу в небольшой городок Форкс. Она влюбляется в загадочного одноклассника, который, как оказалось, происходит из семьи вампиров, отказавшихся от нападений на людей. Влюбиться в вампира. Это страшно? Это романтично, это прекрасно и мучительно, но это не может кончиться добром, особенно в вечном противостоянии вампирских кланов, где малейшее отличие от окружающих уже превращает вас во врага.','films_polls/2017/02/16/сумерки.jpg',0,'2017-02-16 18:24:10.000000'),(50,'Транс (2013)','\r\nСотрудник аукционного дома Саймон отвечает за сохранность картин во время проведения аукциона и в случае опасности должен запереть картину в сейфе. Во время ограбления он получает удар по голове и просыпается в больнице с амнезией. Саймон единственный кто знает, где находится картина, которой нет ни в сейфе, ни у грабителей. Бандиты похищают и пытают его. А после неудавшейся попытки вспомнить, банда нанимает гипно-терапевта Элизабет, которая должна помочь Саймону восстановить местонахождение картины.','films_polls/2017/02/16/транс.jpg',0,'2017-02-16 18:25:48.000000'),(51,'Милые кости (2009)','Фильм рассказывает о переживаниях четырнадцатилетней девушки, изнасилованной и убитой маньяком-соседом. Наблюдая за жизнью домочадцев с небес, героиня мечтает о простых подростковых радостях и жаждет поимки душегуба.','films_polls/2017/02/16/милые_кости.jpg',0,'2017-02-16 18:28:20.000000'),(52,'Чёрный лебедь (2010)','\r\nСюжет картины строится вокруг примы балетного театра, у которой неожиданно появляется опасная конкурентка, способная отобрать у главной героини все партии. Соперничество усиливается по мере приближения ответственного выступления, которое должно решить все.','films_polls/2017/02/16/черныи_лебедь.jpg',0,'2017-02-16 18:29:55.000000'),(53,'Битва преподов (2017)','Когда один школьный учитель добивается увольнения другого, последний вызывает его выяснить отношения после занятий с помощью кулаков.12','films_polls/2017/02/16/битва_преподов.jpg',0,'2017-02-16 18:31:11.000000'),(54,'Экипаж (2012)','Опытный пилот Уип Вайтекер чудом избегает крушения самолета, и, совершив аварийную посадку, сохраняет жизни практически всех пассажиров. Уипа чествуют, как героя, но чем больше появляется подробностей о катастрофе, тем больше вопросов возникает: что же на самом деле произошло на борту самолёта…','films_polls/2017/02/16/экипаж.jpg',0,'2017-02-16 18:32:21.000000'),(55,'Джой (2015)','Волнующая история четырех поколений семьи. В центре сюжета — девушка Джой, превращающаяся в женщину, которая становится основательницей бизнес-династии и ее главой. Предательство и измена, потеря невинности и шрамы любви открывают дорогу в эмоциональную комедию о том, как стать истинным лидером семьи, и о том, как любое предприятие неумолимо сталкивается с миром коммерции. Союзники и противники меняются местами как внутри, так и вне семьи, и только внутренние переживания и неистовое воображение Джой помогают ей пройти через поджидающие ее жизненные бури.','films_polls/2017/02/16/джои.jpg',0,'2017-02-16 18:33:14.000000'),(56,'Американский пирог (1999)','\r\nНа вечеринке четверо старшеклассников, Джим, Кевин, Финч и Оз, выясняют, что никто из них еще не имел сексуального опыта с девушками. Приятели считают, что с коллективной девственностью надо обязательно расстаться до того, как они переступят порог колледжа. На носу школьный выпускной бал, и у друзей осталось совсем мало времени на то, чтобы выполнить задуманное.','films_polls/2017/02/16/американски_пирог.jpg',0,'2017-02-16 18:34:41.000000'),(57,'Операция Ы','аппап','films_polls/2017/02/16/photo_GuI32wW.jpg',1,'2017-02-16 19:32:44.000000'),(58,'Операция Ы','ghg','films_polls/2017/02/16/photo_NME5JrY.jpg',1,'2017-02-16 19:36:24.000000'),(59,'Раскрыть возраст по графу','Немного о фильме','films_polls/2017/02/23/redstone-elevator-3.jpg',1,'2017-02-23 15:45:41.000000'),(60,'пвцгнйпгйцвпгйц','пвцгнйпгйцвпгйц','films_polls/2017/02/23/Снимок_экрана_2017-02-23_в_18.55.48.png',1,'2017-02-23 15:57:09.000000'),(61,'asd','asd','films_polls/2017/03/06/Миксер_мне_в_глаза_.jpg',1,'2017-03-06 11:06:19.000000'),(62,'Операция Ы','ggfhgh','films_polls/2017/03/12/photo.jpg',1,'2017-03-12 18:01:05.440867'),(63,'Операция Ы','fgghjhfhgjhgjhj','films_polls/2017/03/22/photo.jpg',1,'2017-03-22 08:56:14.912088'),(64,'Операция Ы','fgghjhfhgjhgjhj','',1,'2017-03-22 08:59:49.831936'),(65,'Операция Ы','ffhfhfhfh','films_polls/2017/03/22/ruka.jpg',1,'2017-03-22 09:43:18.790076'),(66,'Операция Ы','sdsfds','films_polls/2017/03/22/maxresdefault1.jpg',1,'2017-03-22 09:43:18.790076'),(67,'Операция Ы','dsafd','films_polls/2017/03/22/maxresdefault1_F7jiebp.jpg',1,'2017-03-22 09:47:11.993135');
